// 统一请求路径前缀在libs/axios.js中修改
import { getRequest, postRequest, putRequest, postBodyRequest, getNoAuthRequest, postNoAuthRequest } from '@/libs/axios';

// 分页获取数据
export const getPositionList = (params) => {
    return getRequest('/position/getByPage', params)
}
// 添加
export const addPosition = (params) => {
    return postRequest('/position/insertOrUpdate', params)
}
// 编辑
export const editPosition = (params) => {
    return postRequest('/position/insertOrUpdate', params)
}
// 删除
export const deletePosition = (params) => {
    return postRequest('/position/delByIds', params)
}
